import React from 'react';

const Pokemon = (props) => {
  const { name, type, averageWeight, image } = props.pok

  return (
    <div>
    <p>{name}</p>
    <p>{type}</p>
    <p>{averageWeight.value} {averageWeight.measurementUnit}</p>
    <img src={image} alt="Imagem do Pokemon"></img>
  </div>
  )
}

export default Pokemon;
